1. The key psychological mechanisms include fairness evaluation and an intrinsic bias toward equal splits. In the proposer role, participants may adjust the fair share they offer, which according to token counts is computed as the opponent’s tokens divided by the total tokens. However, they might “anchor” toward an equal (50%) offer independent of the tokens.
2. These mechanisms interact in that the final proposal is a weighted combination of the fairness-perceived share (based on tokens) and the equal split benchmark.
3. A suitable mathematical form is a weighted average between the fair share (derived as token_opp/(token_self + token_opp)) and an equal split (50%). The weights are determined by a single parameter.
4. The only learnable parameter, theta, (with bounds 0 to 1) modulates between relying on fairness (when theta is 0) versus an equality bias (when theta is 1).
