def simulate_model(trial_data, theta=0.5):
    model_predictions = []
    for trial in trial_data:
        token_opp = trial.get("token_opp", 0)
        token_self = trial.get("token_self", 0)

        if (token_self + token_opp) == 0:
            fairness_share = 50  # Avoid division by zero, assume equal split
        else:
            fairness_share = (token_opp / (token_self + token_opp)) * 100

        proposed_perc = theta * 50 + (1 - theta) * fairness_share
        model_predictions.append(proposed_perc)
    return model_predictions
